 მოხდეს?','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'ეს არის დანართის იდენტიფიკატორი, ან სურათის URL, რომელიც გამოიყენება პროდუქტის კატალოგში. მას გამოიყენებს პროდუქტი, რომელსაც არა აქვს სურათი.','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>თქვენი თემა (%s) შეიცავს WooCommerce-ის რამდენიმე მოძველებულ შაბლონს.</strong> ეს ფაილები უნდა განახლდეს WooCommerce-ის მიმდინარე ვერსიასთან თავსებადობისათვის. გირჩევთ შეასრულოთ შემდეგი:','Enter attachment ID or URL to an image'=>'შეიტანეთ სურათის იდენტიფიკატორი, ან URL','Placeholder image'=>'სურათი-შემავსებელი','The "%s" payment method is currently disabled'=>'ანგარიშსწორების არხი "%s" ამ მომენტში გამორთულია','The "%s" payment method is currently enabled'=>'ანგარიშსწორების არხი “%s” ამ მომენტში ჩართულია','Set up the "%s" payment method'=>'დააყენეთ “%s” ანგარიშსწორების არხი','Manage the "%s" payment method'=>'"%s" ანგარიშსწორების არხის მართვა','Move down'=>'გადაადგილება ქვემოთ','Move the "%s" payment method down'=>'გადახდის "%s" გადაადგილება ქვემოთ','Move up'=>'გადაადგილება ზემოთ','Move the "%s" payment method up'=>'გადახდის “%s” გადაადგილება ზემოთ','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'საჭიროა, თუ არა, მისამართის %s დამუშავებისას პირადი მონაცემების შენახვა, ან წაშლა?','When handling an %s, should personal data within orders be retained or removed?'=>'%s-ის დამუშავებისას, პირადის სახის ინფორმაცია უნდა შენარჩუნდეს, თუ წაიშალოს?','Low stock amount'=>'საწყობის მინიმალური ბარიერი','Set up PayPal for me using this email:'=>'PayPal-ის დაყენება ჩემთვის, ამ ელფოსტის მისამართის გამოყენებით:','WooCommerce PayPal Checkout Gateway'=>'WooCommerce PayPal ანგარიშსწორების არხი','Set up Stripe for me using this email:'=>'Stripe-ის დაყენება ჩემთვის, ამ ელფოსტის მისამართის გამოყენებით:','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'%1$s-ის გამოყენება პროდუქტის წონისათვის და %2$s-ის პროდუქტის გაბარიტებისათვის.','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'შეიტანეთ მნიშვნელობა, ნაირსახეობის დონეზე სასაწყობო ნაშთის დასადგენად. გამოიყენეთ ალამი «მარაგის მართვა?» ზემოთ, რათა ჩაირთოს, ან გამოირთოს მარაგების მართვა ნაირსახეობების დონეზე.','ShipStation'=>'ShipStation','ShipStation icon'=>'ShipStation-ის ხატულა','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'ფოსტის განყოფილებაში დროის ეკონომიის მიზნით გირჩევთ მიწოდების იარლიყების სახლში ბეჭდვას, ShipStation-ის საშუალებით. გამოიყენეთ ShipStation უფასოდ 30 დღის განმავლობაში.','WooCommerce Services icon'=>'WooCommerce Services ხატულა','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'მიმდინარე ტარიფი — არის შეკვეთის მიწოდების ზუსტი ღირებულება, რასაც გვთავაზობს უშუალოდ სატრანსპორტო კომპანია.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'თუ გსურთ მიიღოთ <span class="help_tip" data-tip="%1$s">მიმდინარე ტარიფები</span> კონკრეტული გადამზიდავი კომპანიისაგან (მაგ. UPS), შეგიძლიათ გამოიყენოთ WooCommerce-ის ხელმისაწვდომი გაფართოებები <a href="%2$s" target="_blank">აქ</a>.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'ჩვენ შევქმენით მიქოდების ორი ზონა — %s-სათვის და მსოფლიოს დანარჩენი ნაწილისათვის. ქვემოთ შეგიძლიათ მიუთითოთ მიწოდების საფასური ერთიანი ტარიფით ამ ზონებისათვის, ან შესთავაზოთ უფასო მიწოდება.','Yards'=>'იარდი','Inches'=>'დუიმი','Millimeters'=>'მილიმეტრი','Centimeters'=>'სანტიმეტრი','Meters'=>'მეტრი','Ounces'=>'უნციები','Pounds'=>'გირვანქა','Grams'=>'გრამი','Kilograms'=>'კილოგრამი','Item moved down'=>'ელემენტი გადატანილია ქვემოთ','Item moved up'=>'ელემენტი გადატანილია ზემოთ','You may need to manually restore the item\'s stock.'=>'თქვენ შესაძლოა დაგჭირდეთ ამ ნივთის საწყობის ნაშთის აღდგენა ხელით.','Are you sure you want to remove the selected items?'=>'დარწმუნებული ხართ, რომ გსურთ ამ ნივთების წაშლა?','Alto Paraguay'=>'ალტო პარაგვაი','Presidente Hayes'=>'პრესიდენტე-ჰეისი','Amambay'=>'ამამბაი','Central'=>'სენტრალი','Cordillera'=>'კორდილიერა','San Pedro'=>'სან პედრო','Sud Sardegna'=>'სამხრეთ სარდინია','Apartment, suite, unit, etc.'=>'სახლი, ბინა, სართული და ა.შ.','%d API key permanently revoked.'=>'%d API გასაღები წაიშალა სამუდამოდ.','Cannot set attributes due to invalid parent product.'=>'შეუძლებელია ატრიბუტების დაყენება არასწორი მშობელი პროდუქტის გამო.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'ამ ქმედების გაუქმება შეუძებელია. დარწმუნებული ხართ, რომ გსურთ პირადი მონაცემების წაშლა შეკვეთებიდან?','shipping packagesShipping %d'=>'მიწოდება %d','Payer PayPal address'=>'გადამხდელის PayPal-მისამართი','Payer last name'=>'გადამხდელის გვარი','Payer first name'=>'გადამხდელის სახელი','Shipping Address'=>'მიწოდების მისამართი','Billing Address'=>'გადახდის მისამართი','Shipping Address 1'=>'მიწოდების მისამართი 1','Billing Address 1'=>'გადახდის მისამართი 1','MySQL version string.'=>'MySQL-ის ვერსიის სტრიქონი.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'თქვენი CSV უნდა შეიცავდეს სვეტებს გარკვეული თანმიმდევრობით. %1$sდააწკაპუნეთ აქ ნიმუშისათვის%2$s.','This will be how your name will be displayed in the account section and in reviews'=>'სახელი ამ სახით იქნება ნაჩვენები ანგარიშის განყოფილებაში და მიმოხილვებში','If you have a coupon code, please apply it below.'=>'თუ თქვენ გაქვთ კუპონის (ფასდაკლების) კოდი, გთხოვთ ჩაწეროთ ქვემოთ.','terms and conditions'=>'წესები და პირობები','privacy policy'=>'კონფიდენციალურობის პოლიტიკა','United States (US) dollar'=>'ამერიკული დოლარი','eCheck ending in %1$s'=>'eCheck-ის მოქმედების ვადა სრულდება %1$s','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal საშუალებას გაძლევთ გამოგვიგზავნოთ ერთი მისამართი. თუ იყენებთ PayPal-ს მიწოდების ირალიყებისათვის, შესაძლოა უკეთესი იყოს მიწოდების მისამართის გაგზავნა და არა გადახდის მისამართის ნაცვლად. ამ ფუქნციის გამორთვის შედეგად PayPal-ის მიმწოდებლების დაცვის პროგრამამ შესაძლოა ვერ იმუშაოს.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard-ს ამისამართებს მომხმარებლებს PayPal-ზე, საგადახდო რეკვიზიტების შესატანად.','Other locations'=>'სხვა მდებარეობები','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'ნებისმიერი &quot;%1$s&quot; მეთოდი','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'გადახდების მიღება ჩეკების საშუალებით. ამ ავტონომიური ანგარიშსწორების არხის გამოყენება ასევე შესაძლებელია სატესტო შენაძენებისათვის.','Account details:'=>'ანგარიშის დეტალები:','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'გადახდების მიღება საბანკო გადარიცხვით. უფრო ცნობილი, როგორც პირდაპირი, საბანკო/ელექტრონული გადარიცხვა','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'როგორ, რა, არის, ის, რა, არის, ის, არის, რა, არის, რა, ვინ, ერთად, ერთად','Optionally add some text for the terms checkbox that customers must accept.'=>'სურვილისამებრ, დაამატეთ ტექსტი, რომელიც დაადასტურებს მომხმარებლის გადაწყვეტილებას, დაეთანხმოს წესებს.','%s page'=>'%s გვერდი','No page set'=>'გვერდი არ არის მითითებული','Highlight required fields with an asterisk'=>'სავალდებულო ველების ვარსკვლავით მონიშვნა','I have read and agree to the website %s'=>'მე გავეცანი და ვეთანხმები საიტის წესებს, %s','Required'=>'სავალდებულო','%s field'=>'%s ველი','These options let you change the appearance of the WooCommerce checkout.'=>'ეს ფუნქციები საშუალებას გაძლევთ შეცვალოთ WooCommerce-ის შეკვეთის გაფორმების გვერდის სახე.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'იხილეთ <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal კონფიდენციალურობის პოლიტიკა</a> დამატებითი ინფორმაციისათვის.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'ჩვენ ვიღებთ გადახდებს PayPal-ის საშუალებით. გადახდის დამუშავებისას ზოგიერთი თქვენი პირადი მონაცემი გადაეცემა PayPal-ს. მათ შორის ინფორმაცია, რომელიც საჭიროა გადახდის დასამუშავებლად, მაგალითად, შენაძენის საერთო ღირებულება და გადახდის დეტალები.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'ამ სექციაში თქვენ უნდა მიუთითოთ, რომელ გარე საგადახდო სისტემას იყენებთ თქვენს მაღაზიაში გადახდის მისაღებად და როგორ ახდენენ ეს სერვისები მომხმარებლების მონაცემების დამუშავებას. PayPal ჩვენ მოვიყვანეთ როგორც მაგალითი. თუ არ სარგებლობთ PayPal-ის მომსახურებით, ეს ტექსტი უნდა წაშალოთ.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'ჩვენ ვუზიარებთ ინფორმაციას ჩვენს პარტნიორებს, რომლებიც გვეხმარებიან თქვენი შეკვეთის შესრულებაში. მათ შორის არიან --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'ამ სექციაში თქვენ უნდა მიუთითოთ მესამე მხარეები, რომლებსაც თქვენ გადასცემთ ინფორმაციას და უნდა მიუთითოთ, თუ რატომ აკეთებთ ამას. ამ მიზნებს შესაძლოა განეკუთვნებოდეს, მაგალითად, მონაცემთა ანალიზი, მარკეტინგი, ანგარიშსწორების არხებით უზრუნველყოფა და მესამე მხარის ჩადგმები.','What we share with others'=>'რა ინფორმაციას ვუზიარებთ მესამე პირებს','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'ჩვენს გუნდს ესაჭიროებაწვდომა ამ ინფორმაციაზე, რათა შეასრულოს შეკვეთა, დააბრუუნოს თანხები და მხარდაჭერა გაგიწიოთ.','Customer information like your name, email address, and billing and shipping information.'=>'მომხმარებლის ინფორმაცია, რომელსაც განეკუთვნება თქვენი სახელი, ელფოსტის მისამართი, საგადახდო მონაცემები და ინფორმაცია შეკვეთის მიწოდების შესახებ.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'ინფორმაცია შეკვეთის შესახებ: შეძენილი პროდუქტის დასახელება, შეძენის დრო, მიწოდების მისამართი, აგრეთვე','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'ჩვენი გუნდის წევრებს აქვთ წვდომა ინფორმაციაზე, რომელსაც თქვენ გვაწვდით. მაღაზიის ადმინისტრატორს და მენეჯერს აქვთ წვდომა შემდეგ მონაცემებზე:','Who on our team has access'=>'თქვენი გუნდის რომელ წევრებს აქვთ წვდომა','We will also store comments or reviews, if you choose to leave them.'=>'ჩვენ ასევე შევინახავთ თქვენს კომენტარებს და გამოხმაურებებს.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'როგორც წესი, ინფორმაციას თქვენს შესახებ ჩვენ ვინახავთ იმდენი ხანი, რამდენიც ეს საჭიროა იმ მიზნებისათვის, რის გამოც ვაგროვებთ ამ ინფორმაციას. გამონაკლის წარმოადგენს შემთხვევა, როდესაც ჩვენ ვალდებული ვართ განვაგრძოთ ამ ინფორმაციის შენახვა, კანონმდებლობის მოთხოვნების გათვალისწინებით. მაგალითად, ინფორმაცია შეკვეთის შესახებ ჩვენთან ინახება XXX წელი, საგადასახადო და ბუღალტრული მოთხოვნების თანახმად. ამ მონაცემებს მიეკუთვნება თქვენი სახელი, ელფოსტის მისამართი, გადახდისა და მიწოდების მისამართი.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'თუ თქვენ შექმნით ანგარიშს, ჩვენ შევინახავთ თქვენს სახელს, ელფოსტის მისამართს და ტელეფონის ნომერს, სამომავლოდ ახალი შეკვეთის მონაცემების ავტომატურად შესავსებად.','Send you marketing messages, if you choose to receive them'=>'თქვენთან სარეკლამო შეტყობინენების გაგზავნა (თუ თანახმა იქნებით, რომ მიიღოთ)','Improve our store offerings'=>'ჩვენი მაღაზიის ასორტიმენტის გაუმჯობესება','Comply with any legal obligations we have, such as calculating taxes'=>'კანონმდებლობის მოთხოვნების შესრულება (მაგალითად, გადასახადების გაანაგარიშება)','Set up your account for our store'=>'შექმენიტ ანგარიში ჩვენს მაღაზიაში','Process payments and prevent fraud'=>'გადახდების დამუშავება და ბრძოლა თაღლითობასთან','Respond to your requests, including refunds and complaints'=>'თქვენს მოთხოვნებზე პასუხი, მათ შორის თანხების უკან მოთხოვნაზე და პრეტენზიებზე','Send you information about your account and order'=>'თქვენთან თქვენი ანგარიშისა და შეკვეთის ინფორმაციის გადმოგზავნა','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'თუ მოგინდებათ ჩვენთან რაიმეს შეძენა, თქვენ მოგიწევთ გარკვეული ინფორმაციის მოწოდება, მათ შორის სახელის, გადახდის მისამართის, მიწოდების მისამართის, ელფოსტის მისამართის, ტეელფონის ნომერის, საბანკო ბარათის , ან ანგარიშის რეკვიზიტების, აგრეთვე დამატებითი ინფორმაციის თქვენი ანგარიშის შესახებ, როგორიცაა სახელი და პაროლი. ჩვენ ვიყენებთ აღნიშნულ ინფორმაციას შემდეგი მიზნებისათვის:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'შენიშვნა: შესაძლოა, მოგიწიოთ ქუქი-ფაილების პოლიტიკის აღწერა და მის შესახებ ბმულის დამატება აქ.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'ჩვენ ასევე ვიყენებთ ქუქი-ფაილებს, რათა თავლყური ვადევნოთ, თუ რას ამატებთ კალათში, სანამ ჩვენს საიტზე იმყოფებით.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'მიწოდების მისამართი: ჩვენ გთხოვთ მიუთითოთ მხოლოდ ეს მისამართი, რათა, კერძოდ შევაფასოთ მიწოდების ღირებულება შეკვეთის განთავსებამდე და მოგაწოდოთ შეკევეთილი პროდუქტები!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'მდებარეობა, IP მისამართი და ბრაუზერის ტიპი: ჩვენ ვიყენებთ ამ ინფორმაციას გადასახადების გაანგარიშებისათვის და მიწოდების ღირებულებისათვის','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'თქვენს მიერ ნანახი პროდუქტები:  ჩვენ ვინახავთ ამ მონაცემებს, რათა გაჩვენოთ პროდუქტები, რომლებითაც თქვენ ამასწინათ დაინტერესდით','While you visit our site, we’ll track:'=>'როდესაც სტუმრობთ ჩვენს საიტს, ჩვენ ვინახავთ შემდეგ მონაცემებს თქვენს შესახებ:','What we collect and store'=>'რას მონაცემებს ვაგროვებთ და ვინახავთ თქვენს შესახებ','We collect information about you during the checkout process on our store.'=>'შეკვეთის გაფორმებისას ჩვენს მაღაზიაში ჩვენ ვაგროვებთ მონაცემებს თქვენს შესახებ.','This sample language includes the basics around what personal data your s