ასწორი პარამეტრების ჯგუფი.','Settings group ID.'=>'პარამეტრების ჯგუფის იდენტიფიკატორი.','Limit result set to products based on a maximum price.'=>'პროდუქტების დაფილტვრა მაქსიმალური ფასით.','Limit result set to products based on a minimum price.'=>'პროდუქტების დაფილტვრა მინიმალური ფასით.','Limit result set to products on sale.'=>'პროდუქტების დაფილტვრა ფასდაკლებით.','Limit result set to products in stock or out of stock.'=>'პროდუქტების დაფილტვრა ნაშთის არსებობით, ან არა.','Limit result set to products with a specific tax class.'=>'პროდუქტების დაფილტვრა გადასახადების კლასით.','Limit result set to featured products.'=>'პროდუქტების დაფილტვრა რეკომენდებულის მიხედვით.','List of variations IDs.'=>'ნაირსახეობების იდენტიფიკატორიების სია.','The date the product was last modified, as GMT.'=>'პროდუქტის ბოლო ცვლილების თარიღი, (GMT ფორმატში).','The date the product was created, as GMT.'=>'პროდუქტის შექმნის თარიღი, (GMT ფორმატში).','Number of days until access to downloadable files expires.'=>'ცამოტვირთვად ფაილზე წვდომის დასრულებამდე დარჩენილი დღეების რაოდენობა.','Number of times downloadable files can be downloaded after purchase.'=>'რამდენჯერ შეიძლება ფაილის ჩამოტვირთვა შეძენის შემდგომ.','Start date of sale price, as GMT.'=>'ამ ფასად გაყიდვების დაწყების თარიღი (GMT).','Start date of sale price, in the site\'s timezone.'=>'ფასდაკლების პერიოდის დაწყების თარიღი, მაღაზიის დროის სარტყელის მიხედვით.','The date the review was created, as GMT.'=>'მიმოხილვის შექმნის თარიღი, (GMT ფორმატში).','The content of the review.'=>'მიმოხილვის შიგთავსი.','End date of sale price, in the site\'s timezone.'=>'ფასდაკლების პერიოდის დასრულების თარიღი, მაღაზიის დროის სარტყელის მიხედვით.','The date the image was last modified, as GMT.'=>'სურათის ბოლო ცვლილების თარიღი, (GMT ფორმატში).','The date the image was created, as GMT.'=>'სურათის შექმნის თარიღი, (GMT ფორმატში).','Placeholder text to be displayed in text inputs.'=>'შემავსებელი ტექსტი შეტანის ველში.','Additional help text shown to the user about the setting.'=>'დამატებითი ტექსტი მომხმარებლისათვის მორგების აღწერით.','Default value for the setting.'=>'პარამეტრის ნაგულისხმევი მნიშვნელობა.','Setting value.'=>'პარამეტრის მნიშვნელობა.','Type of setting.'=>'პარამეტრის ტიპი.','A unique identifier for the setting.'=>'უნიკალური იდენტიფიკატორი პარამეტრისათვის.','Payment gateway settings.'=>'ანგარიშსწორების არხის პარამეტრები.','Payment gateway method description.'=>'ანგარიშსწორების არხის აღწერა.','A human readable description for the setting used in interfaces.'=>'ადამიანის მიერ აღქმადი აღწერა ინტერფეისის პარამეტრებში.','A human readable label for the setting used in interfaces.'=>'ადამიანის მიერ აღქმადი აღწერა ინტერფეისის პარამეტრებში.','Payment gateway method title.'=>'ანგარიშსწორების არხის სათაური.','Payment gateway enabled status.'=>'ანგარიშსწორების არხის სტატუსი.','Payment gateway sort order.'=>'ანგარიშსწორების არხის დახარისხება.','Payment gateway description on checkout.'=>'ანგარიშსწორების არხის აღწერა შეკვეთის გაფორმების დასრულებისას.','Payment gateway title on checkout.'=>'ანგარიშსწორების არხის დასახელება შეკვეთის გაფორმების დასრულებისას.','Payment gateway ID.'=>'ანგარიშსწორების არხის იდენტიფიკატორი.','The date the order was completed, as GMT.'=>'შეკვეთის შესრულების თარიღი, (GMT ფორმატში).','The date the order was paid, as GMT.'=>'შეკვეთის გადახდის თარიღი, (GMT ფორმატში).','The date the order was last modified, as GMT.'=>'შეკვეთის ბოლო ცვლილების თარიღი, (GMT ფორმატში).','Version of WooCommerce which last updated the order.'=>'WooCommerce-ის რომელ ვერსიაში განახლდა ბოლოჯერ შეკვეთა.','When true, the payment gateway API is used to generate the refund.'=>'როდესაც ეს პარამეტრი ჭეშმარიტია, თანხის დაბრუნება ხდება ანგარიშსწორების არხის API-ს საშუალებით.','User ID of user who created the refund.'=>'მომხმარებლის იდენტიფიკატორი, რომელმაც დააბრუნა პროდუქტი.','The date the order refund was created, as GMT.'=>'შეკვეთის თანხის დაბრუნების თარიღი, (GMT ფორმატში).','Limit result to customers or internal notes.'=>'შედეგების გაფილტვრა მომხმარებლების, ან შიდა მინაწერების მიხედვით.','If true, the note will be shown to customers and they will be notified. If false, the note will be for admin reference only.'=>'როდესაც ეს პარამეტრი ჭეშმარიტია, მინაწერი გამოჩნდება მომხმარებელთან და მას გაეგზავნება შეტყობინება. თუ ეს პარამეტრი არა არის ჭეშმარიტი, მინაწერს მხოლოდ ადმინისტრატორი დაინახავს.','The date the order note was created, as GMT.'=>'შეკვეთის მინაწერის შექმნის თარიღი, (GMT ფორმატში).','Is the customer a paying customer?'=>'გადახდისუნარიანი მომხმარებელია?','The date the customer was last modified, as GMT.'=>'მომხმარებლის ბოლო ცვლილების თარიღი, (GMT ფორმატში).','The date the order was created, as GMT.'=>'მომხმარებლის შექმნის თარიღი, (GMT ფორმატში).','The date when download access expires, as GMT.'=>'ჩამოტვირთვის ბმულისმოქმედების ვადის ამოწურვა, (GMT ფორმატში).','Meta ID.'=>'მეტამონაცემების იდენტიფიკატორი.','List of user IDs (or guest email addresses) that have used the coupon.'=>'მომხმარებელთა იდენტიფიკატორების სია (ანდა სტუმრების ელფოსტის მისამართები), რომლებმაც გამოიყენეს კუპონი.','If true, this coupon will not be applied to items that have sale prices.'=>'როდესაც ეს პარამეტრი ჭეშმარიტია, ეს კუპონი არ იქნება გამოყენებული იმ ნივთებზე, რომლებზეც არის ფასდაკლება.','If true and if the free shipping method requires a coupon, this coupon will enable free shipping.'=>'როდესაც ეს პარამეტრი ჭეშმარიტია და უფასო მიწოდებისათვის საჭიროა კუპონი, ეს კუპონი მომხმარებელს უფლებას მისცემს უფასო მიწოდებაზე.','Meta data.'=>'მეტა მონაცემები.','How many times the coupon can be used in total.'=>'კუპონის გამოყენების საერთო რაოდენობა.','If true, the coupon can only be used individually. Other applied coupons will be removed from the cart.'=>'როდესაც ეს პარამეტრი ჭეშმარიტია, კუპონის გამოყენება მხოლოდ ცალკე არის შესაძლებელი. სხვა კუპონები წაიშლება კალათიდან.','The date the coupon expires, as GMT.'=>'კუპონის ვადის ამოწურვის თარიღი, (GMT ფორმატში).','The date the coupon expires, in the site\'s timezone.'=>'კუპონის მოქმედების ვადის ამოწურვის თარიღი, (GMT ფორმატში).','The date the coupon was last modified, as GMT.'=>'კუპონის ბოლო ცვლილების თარიღი, (GMT ფორმატში).','The date the coupon was created, as GMT.'=>'კუპონის შექმნის თარიღი, (GMT ფორმატში).','The amount of discount. Should always be numeric, even if setting a percentage.'=>'ფასდაკლების ოდენობა. ყოველთვის რიცხვით ფორმატში, მაშინაც კი, როცა არის პროცენტი.','Missing OAuth parameter %s'=>'არ არის OAuth პარამეტრი %s','From %1$s to %2$s'=>'საწყისი: %1$s, საბოლოო: %2$s','Set to regular price decreased by (fixed amount or %):'=>'ჩვეულებრივი ფასის დაყენება, რომელიც შემცირებულია (ფიქსირებული თანხა, ან %):','Decrease existing sale price by (fixed amount or %):'=>'არსებული ფასის შემცირება (ფიქსირებული თანხა, ან %):','Increase existing sale price by (fixed amount or %):'=>'არსებული ფასის გაზრდა (ფიქსირებული თანხით ან %):','Learn how to update'=>'ისწავლეთ როგორ განაახლოთ','Outdated templates'=>'ვადაგასული შაბლონები','%1$s version %2$s is out of date. The core version is %3$s'=>'%1$s შაბლონის ვერსია %2$s ვადაგასულია. ბირთვის ვერსია: %3$s','— No change —'=>'— ცვლილების გარეშე —','Page visibility should be <a href="%s" target="_blank">public</a>'=>'გვერდი უნდა იყოს <a href="%s" target="_blank">საჯარო</a>','Edit %s page'=>'გვერდის %s ჩასწორება','Taxonomies: Product types'=>'ტაქსონომია: პროდუქტის ტიპები','Error messages should not be shown to visitors.'=>'შეცდომის შეტყობინებები არ გამოჩნდება სტუმრებისთვის.','Error messages can contain sensitive information about your store environment. These should be hidden from untrusted visitors.'=>'შეცდომის შეტყობინებები შეიძლება შეიცავდეს მნიშვნელოვან ინფორმაციას თქვენი მაღაზიის გარემოს შესახებ. ის უნდა იყოს დამალული სტუმრებისგან.','Hide errors from visitors'=>'შეცდომების დამალვა სტუმრებისაგან','Your store is not using HTTPS. <a href="%s" target="_blank">Learn more about HTTPS and SSL Certificates</a>.'=>'თქვენი მაღაზია არ იყენებს HTTPS. <a href="%s" target="_blank">შეიტყვეთ უფრო მეტი HTTPS და SSL სერთიფიკატების შესახ