ა.','Secret key used to generate a hash of the delivered webhook and provided in the request headers. This will default to a MD5 hash from the current user\'s ID|username if not provided.'=>'საიდუმლო გასაღები, რომელიც გამოიყენება ჰეშის გენერაციისათვის მიწოდებული ვებჰუკისათვის და რომელიც წარმოდგენილია მოთხოვნის ქუდში. ნაგულისხმევად გამოყენებული იქნება მიმდინარე მომხმარებლის სახელის|იდენტიფიკატორის MD5-ჰეში, თუ სხვა რამ არ არის მითითებული.','WooCommerce action names associated with the webhook.'=>'WooCommerce-ის ქმედებების დასახელება, რომლებიც დაკავშირებულია ამ ვებჰუკთან.','Webhook event.'=>'ვებჰუკის შემთხვევა.','Webhook resource.'=>'ვებჰუკის რესურსი.','Webhook topic.'=>'ვებჰუკის თემა.','Webhook status.'=>'ვებჰუკის სტატუსი.','A friendly name for the webhook.'=>'ვებჰუკის მეგობრული სახელი.','Webhook topic must be valid.'=>'ვებჰუკის თემა ძალაში უნდა იყოს.','Webhook delivery URL must be a valid URL starting with http:// or https://.'=>'ვებჰუკის მიწოდების URL უნდა იყოს კორექტული და უნდა იწყებოდეს http:// ან https://.','Webhook topic is required and must be valid.'=>'ვებჰუკის თემა სავალდებულოა და ძალაში უნდა იყოს.','The date the webhook delivery was logged, in the site\'s timezone.'=>'ვებჰუკის მიწოდების თარიღი ჩაწერილია ჟურნალში, საიტის დროის სარტყელში.','The response body from the receiving server.'=>'მიმღები სერვერის პასუხის სხეული.','Array of the response headers from the receiving server.'=>'პასუხის სათაურების მასივი მიმღები სერვერიდან.','The HTTP response message from the receiving server.'=>'HTTP საპასუხო შეტყობინება მიმღები სერვერიდან.','The HTTP response code from the receiving server.'=>'HTTP საპასუხო კოდი მიმღები სერვერიდან.','Request body.'=>'მოთხოვნის სხეული.','Request headers.'=>'მოთხოვნის ქუდი.','The URL where the webhook was delivered.'=>'ვებჰუკის მიწოდების URL.','A friendly summary of the response including the HTTP response code, message, and body.'=>'პასუხის წაკითხვადი რეზიუმე, რომელიც შეიცავს HTTP პასუხის კოდს, შეტყობინებას და სხეულს.','The delivery durat