ady.'=>'რამდენჯერ იყო კუპონი უკვე გამოყენებული.','UTC DateTime when the coupon expires.'=>'UTC თარიღი და დრო, როდესაც კუპონს ვადა გაუვა.','Determines the type of discount that will be applied.'=>'განსაზღვრავს ფასდაკლების ტიპს, რომელიც გამოყენებული იქნება.','Coupon description.'=>'კუპონის აღწერა.','The date the coupon was last modified, in the site\'s timezone.'=>'კუპონის ჩასწორების ბოლო თარიღი, საიტის დროის სარტყელში.','The date the coupon was created, in the site\'s timezone.'=>'კუპონის შექმნის თარიღი, საიტის დროის სარტყელში.','Coupon code.'=>'კუპონის კოდი.','Unique identifier for the object.'=>'ობიექტის უნიკალური იდენტიფიკატორი.','The coupon code cannot be empty.'=>'კუპონის კოდი არ შეიძლება იყოს ცარიელი.','Whether to bypass trash and force deletion.'=>'სამუდამო წაშლა, ნაგვის ყუთის გვერდის ავლით.','The API key provided does not have write permissions.'=>'API გასაღებს არა აქვს ჩაწერის უფლება.','The API key provided does not have read permissions.'=>'API გასაღებს არა აქვს წაკითხვის უფლება.','Invalid nonce - nonce has already been used.'=>'არასწორი მიმდინარე დრო — ეს დრო უკვე იყო გამოყენებული.','Invalid timestamp.'=>'დროის არასწორი ნიშნული.','Invalid signature - provided signature does not match.'=>'არასწორი ხელმოწერა — წარმოდგენილი ხელმოწერა არ დაემთხვა.','Invalid signature - signature method is invalid.'=>'არასწორი ხელმოწერა — ხელმოწერის არასწორი მეთოდი.','Invalid signature - failed to sort parameters.'=>'არასწორი ხელმოწერა — ვერ მოხერხდა პარამეტრების დახარისხება.','Consumer key is invalid.'=>'მომხმარებლის გასაღები არასწორია.','Customers will not be able to purchase physical goods from your store until a shipping method is available.'=>'მომხმარებლები ვერ შეძლებენ ფიზიკური პროდუქტების შეძენას მაღაზიაში მანამ, სანამ არ იქნება ხელმისაწვდომი მიწოდების ერთ-ერთი სახე.','Shipping is currently enabled, but you have not added any shipping methods to your shipping zones.'=>'მიწოდება ჩართულია, მაგრამ მიწოდების მეთოდები არ არის დამატებული მიწოდების ზონებზე.','Add shipping methods &amp; zones'=>'მიწოდების მეთოდისა და ზონის დამატება','Learn more about shipping zones'=>'გაიგეთ მეტი მიწოდების ზონებზე','Setup shipping zones'=>'მიწოდების ზონების აწყობა','Legacy shipping methods (flat rate, international flat rate, local pickup and delivery, and free shipping) are deprecated but will continue to work as normal for now. <b><em>They will be removed in future versions of WooCommerce</em></b>. We recommend disabling these and setting up new rates within shipping zones as soon as possible.'=>'მიწოდების ადრეული მეთოდები (ფიქსირებული განაკვეთი, საერთაშორისო ფიქსირებული განაკვეთი, თვითგატანა და უფასო მიწოდება) მოძველდა, მაგრამ ჯერ მოქმედებენ ჩვეულ რეჟიმში. <b><em>ისინი წაიშლება WooCommerce-ის შემდგომ ვერსიებში</em></b>. ჩვენ გირჩევთ გამორთოთ ეს მეთოდები და დააყენოთ ახალი განაკვეთები მიწოდების ზონების მეშვეობით, რაც შეიძლება მალე.','WooCommerce database update'=>'WooCommerce-ის მონაცემთა ბაზის განახლება','Rest of the world'=>'დანარჩენი სამყარო','a group of regions that can be assigned different shipping methods and rates.'=>'რეგიონების ჯგუფი, რომლებზეც შესაძლებელია მიწოდების გაკრვეული მეთოდებისა და ტარიფების მისადაგება.','New:'=>'ახალი:','Archive template'=>'არქივის შაბლონი','Page ID is set, but the page does not exist'=>'გვერდის იდენტიფიკარტორი დაყენდა, მაგრამ გვერდი არ არსებობს','Dismiss'=>'უარყოფა','Your theme has a woocommerce.php file, you will not be able to override the woocommerce/archive-product.php custom template since woocommerce.php has priority over archive-product.php. This is intended to prevent display issues.'=>'თქვენს თემაში არის ფაილი woocommerce.php file, თქვენ არ შეგიძლიათ გადააკეთოთ woocommerce/archive-product.php მორგებული შაბლონი მას შემდეგ, რაც woocommerce.php-ს გააჩნია უპირატესობა archive-product.php-ის მიმართ. ეს ტავიდან აგაცილებთ გამოსახვის პრობლემებს.','MaxMind GeoIP database.'=>'MaxMind GeoIP მონაცემთა ბაზა.','Your server does not support the %s function - this is required to use the GeoIP database from MaxMind.'=>'თქვენი სერვერი მზარს არ უჭერს %s ფუნქციას — ის საჭიროა MaxMind-ის GeoIP მონაცემთა ბაზის გამოსაყენებლად.','WordPress requirements'=>'WordPress-ის მოთხოვნები','The version of cURL installed on your server.'=>'cURL-ის ვერსია, რომელიც დაყენებულია თქვენს სერვერზე.','cURL version.'=>'cURL-ის ვერსია.','Displays whether or not WP Cron Jobs are enabled.'=>'აჩვენებს, ჩართულია თუ არა WP Cron Jobs.','The secret key is used to generate a hash of the delivered webhook and provided in the request headers.'=>'საიდუმლო გასაღები გამოიყენება მოწოდებული ვებჰუკის ჰეშის დაგენერირებისათვის და წარმოდგენილია მოთხოვნის სათაურში.','List 1 postcode per line'=>'საფოსტო ინდექსები, თითო ინდექსი თითო სტრიქონზე','Limit to specific ZIP/postcodes'=>'გარკვეული საფოსტო ინდექსებით შეზღუდვა','Postcode for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all areas. Wildcards (*) and ranges for numeric postcodes (e.g. 12345...12350) can also be used.'=>'ამ წესის საფოსტო ინდექსი. წერტილ-მძიმე (;) გამოყოფს რამოდენიმე მნიშვნელობას. დატოვეთ ცარიელი, ყველაზე ზონაზე მისასადაგებლად. ასევე შესაძებელია ტრაფარეტის სიმბოლოს (*) და საფოსტო კოდის ციფრული დიაპაზონების (მაგ. 12345…12350) გამოყენება.','Add as many zones as you need &ndash; customers will only see the methods available for their address.'=>'შექმენით იმდენი ზონა, რამდენიც გესაჭიროებათ — მომხმარებელი დაინახავს მხოლოდ იმ მეთოდებს, რომლებიც მისადაგებულია მის მისამართზე.','Europe zone = Any country in Europe = Flat rate shipping'=>'ევროპული ზონა = ევროპის ნებისმიერი ქვეყანა = ერთიანი განაკვეთი','US domestic zone = All US states = Flat rate shipping'=>'აშშ-ს შიდა ზონა = აშშ ყველა შტატი = მიწოდება ფიქისრებული განაკვეთით','For example:'=>'მაგალითად:','Add shipping zone'=>'მიწოდების ზონის დამატება','Region(s)'=>'რეგიონ(ებ)ი','Zone name'=>'ზონის სახელი','Drag and drop to re-order your custom zones. This is the order in which they will be matched against the customer address.'=>'აირჩიეთ და გადაათრიეთ მორგებული ზონები. ამ თანმიმდევრობით მოხდება მათი შეპირისპირება მომხმარებლის მისამართთან.','A shipping zone is a geographic region where a certain set of shipping methods and rates apply.'=>'მიწოდების ზონა — გეოგრაფიული რეგიონია, სადაც ვრცელდება გადაზიდვის მეთოდებისა და განაკვეთების გარკვეული ნაკრები.','Close modal panel'=>'მოდალური სარკმელის დახურვა','You can add multiple shipping methods within this zone. Only customers within the zone will see them.'=>'შეგიძლიათ დაამატოთ მიწოდების რამოდენიმე ხერხი, ამ ზონის ფარგლებში. მხოლოდ ამ ზონის მომხმარებლები დაინახავენ მათ.','Add shipping method'=>'მიწოდების მეთოდის დამატება','No shipping classes have been created.'=>'მიწოდების კლასები შექმნილი არ არის.','Add shipping class'=>'მიწოდების კლასის დამატება','Product count'=>'პროდუქტის რაოდენობა','Edit failed. Please try again.'=>'ჩასწორება ვერ მოხერხდა. გთხოვთ სცადოთ ხელახლა.','This shipping method does not have any settings to configure.'=>'მიწოდების ამ მეთოდს არ გააჩნია მორგებადი პარამეტრები.','Shipping method could not be added. Please retry.'=>'ვერ დაემატა მიწოდების მეთოდი. გთხოვთ ხელახლა სცადოთ.','Your changes were not saved. Please retry.'=>'ცვლილებების შენახვა ვერ მოხერხდა. სცადეთ ხელახლა.','Do you wish to save your changes first? Your changed data will be discarded if you choose to cancel.'=>'გსურთ ცვლილებების დამახსოვრება? თქვენი ცვლილებები გაუქმდება, თუ აირჩევთ გაუქმებას.','Zone does not exist!'=>'ზონა არ არსებობს!','Force shipping to the customer billing address'=>'მომხმარებლის მისამართზე იძულებითი მიწოდება','Default to customer billing address'=>'ნაგულისხმევად მომხმარებლის გადახდის მისამართზე','Default to customer shipping address'=>'ნაგულისხმევად მომხმარებლის მიწოდების მისამართზე','Calculations'=>'გაანგარიშებები','Show subcategories &amp; products'=>'ქვეკატეგორიებისა და პროდუქტების ჩვენება','Show categories &amp; products'=>'კატეგორიებისა და პროდუქტების ჩვენება','Show categories'=>'კატეგორიების ჩვენება','No location by default'=>'ნაგულისხმევი მდებარეობა არ არის','This option determines a customers default location. The MaxMind GeoLite Database will be periodically downloaded to your wp-content directory if using geolocation.'=>'ეს პარამეტრი განსაზღვრავს მომხმარებლის ნაგულისხმევ ადგილმდებარეობას. MaxMind-ის GeoLite მონაცემთა ბაზა პერიოდულად ჩაიტვირთება თქვენს საქაღალდეში wp-content.','Default customer location'=>'მომხმარებლის ძირითადი მდებარეობა','Ship to specific countries'=>'მიწოდება სპეციფიურ ქვეყნებში','Disable shipping &amp; shipping calculations'=>'მიწოდების და მიწოდების გაანგარიშებების გამორთვა','Shipping location(s)'=>'მიწოდების მდებარეობ(ები)ა','Sell to specific countries'=>'გაყიდვა მხოლოდ სპეციფიურ ქვეყნებში','Sell to all countries, except for&hellip;'=>'გაყიდვა ყველგან გარდა&hellip;','Endpoint for the setting a default payment method page.'=>'გადახდის მეთოდის მორგების გვერდის ნაგულისხმევი საბოლოო წერტილი.','Set default payment method'=>'ნაგულისხმევი გადახდის საშუალების დაყენება','Endpoint for the delete payment method page.'=>'გადახდის მეთოდის წაშლის გვერდის ენდპოინტი.','Delete payment method'=>'გადახდის მეთოდის წაშლა','Endpoint for the "My account &rarr; Payment methods" page.'=>'„ჩემი ანგარიში &rarr; გადახდის მეთოდები“ გვერდის საბოლოო წერტილი.','Payment methods'=>'გადახდის მეთოდები','Addresses'=>'მისამართები','Downloads'=>'ჩამოტვირთვები','Note: the refund reason will be visible by the customer.'=>'შენიშვნა: დაბრუნების მიზეზი გამოჩნდება მომხმარებელთან.','This order is no longer editable.'=>'ეს შეკვეთა არ ექვემდებარება ჩასწორებას.','Add item(s)'=>'ნივთ(ებ)ის დამატება','Delete item'=>'ნივთის წაშლა','Edit item'=>'ნივთის ჩასწორება','Customer download link'=>'მომხმარებლის გადმოსაწერი ბმული','Stock quantity'=>'რაოდენობა მარაგში','Tax status'=>'გადასახადის სტატუსი','A simple offline gateway that lets you accept cash on delivery.'=>'მარტივი ანგარიშსწორების არხი, რომელიც საშუალებას გაძლევთ მიიღოთ ნაღდი ფული მიწოდებისას.','A simple offline gateway that lets you accept BACS payment.'=>'მარტივი ანგარიშსწორების არხი, რომელიც საშუალებას გაძლევთ მიიღოთ გადახდა საბანკო მეთოდით.','A simple offline gateway that lets you accept a check as method of payment.'=>'მარტივი ანგარიშსწორების არხი, რომელიც საშუალებას გაძლევთ მიიღოთ გადახდა ჩეკის საშუალებით.','Check payment methodCheck payments'=>'გადახდა ჩეკით','Accept payments via PayPal using account balance or credit card.'=>'გადახდების მიღება PayPal-ის საშუალებით, ანგარიშის ბალანსის, ან საბანკო ბარათის გამოყენებით.','Ready to start selling something awesome?'=>'მზად ხართ გაყიდოთ რაიმე არაჩვეულებრივი?','Learn more about coupons'=>'გაიგეთ მეტი კუპონების შესახებ','Coupons are a great way to offer discounts and rewards to your customers. They will appear here once created.'=>'კუპონი შესანიშნავი საშუალებაა ფასდაკლების აქციისათვის, ან მომხმარებლების დაჯილდოებისათვის. ისინი აქ გამოჩნდება.','Learn more about orders'=>'გაიგეთ მეტი შეკვეთების შესახებ','When you receive a new order, it will appear here.'=>'ახალი შეკვეთები აქ გამოჩნდება.','Community forum'=>'საზოგადოების ფორუმი','Help &amp; Support'=>'დახმარება და მხარდაჭერა','Bank transfer (BACS) payments'=>'საბანკო მეთოდით (BACS) გადარიცხვა','Are you sure you wish to delete this note? This action cannot be undone.'=>'დარწმუნებული ხართ, რომ გსურთ ამ მინაწერის წაშლა? ამ ქმედების გაუქმება შეუძლებელია.','Items'=>'ნივთები','Limit result set to resources with a specific slug.'=>'რესურსების დაფილტვრა, გარკვეული ჭდით.','Limit result set to resources assigned to a specific product.'=>'რესურსების დაფილტვრა, გარკვეული პროდუქტით.','Whether to hide resources not assigned to any products.'=>'დაიმალოს, თუ არა რესურსები, რომლებიც არავიზე არ არის მინიჭებული.','Sort collection by resource attribute.'=>'კოლექციის დახარისხება რესურსების ატრიბუტების მიხედვით.','The resource cannot be deleted.'=>'რესურსის წაშლა შეუძლებელია.','Resource does not support trashing.'=>'რესურსის წაშლა არ არის გათვალისწინებული.','Can not set resource parent, taxonomy is not hierarchical.'=>'ვერ მოხერხდა რესურსის მშობელის დაყენება, ტაქსონომია არ არის იერარქიული.','Resource does not exist.'=>'რესურსი არ