','Delivery fee'=>'მიწოდების საფასური','Fixed amount per product'=>'ფიქსირებული ფასი ყოველ პროდუქტზე','Percentage of cart total'=>'შეკვეთის ღირებულების პროცენტი','Fixed amount'=>'ფიქსირებული თანხა','How to calculate delivery charges'=>'როგორ გამოვთვალოთ მიწოდების საფასური','Fee type'=>'საფასურის ტიპი','Enable'=>'ჩართვა','Excluding selected countries'=>'მონიშნული ქვეყნების გარდა','Selected countries'=>'შერჩეული ქვეყნები','Users will need to spend this amount to get free shipping (if enabled above).'=>'მომხმარებელმა უნდა დახარჯოს ეს თანხა, რათა მიიღოს უფასო მიწოდება (თუ ის ჩართულია).','Minimum order amount'=>'შეკვეთის მინიმალური თანხა','A minimum order amount AND a coupon'=>'შეკვეთის მინიმალური თანხა და კუპონი','A minimum order amount OR a coupon'=>'შეკვეთის მინიმალური თანხა, ან კუპონი','A valid free shipping coupon'=>'უფასო მიწოდების მოქმედი კუპონი','Free shipping requires...'=>'უფასო გადაზიდვის მოთხოვნები…','Method availability'=>'ხელმისაწვდომობის მეთოდი','Option name | Additional cost [+- Percents%] | Per cost type (order, class, or item)'=>'პარამეტრის სახელი | დამატებითი ღირებულება [+ - პროცენტი%] | ფასის ტიპი (შეკვეთა, კლასი, ან ნივთი)','One per line: Option name | Additional cost [+- Percents] | Per cost type (order, class, or item) Example: <code>Priority mail | 6.95 [+ 0.2%] | order</code>.'=>'ერთი თითო ხაზზე: პარამეტრის სახელი | დამატებითი ღირებულება [+ - პროცენტი] | ფასის ტიპი (შეკვეთა, კლასი, ან ნივთი) მაგალითი: <code>სასწრაფო საფოსტო | 6.95 [+ 0.2%] | შეკვეთა</code> .','These rates are extra shipping options with additional costs (based on the flat rate).'=>'მიწოდების დამატებითი პარამეტრები (გადახდილი სტანდარტულ ტარიფზე).','Additional rates'=>'დამატებითი განაკვეთები','Per order: Charge shipping for the most expensive shipping class'=>'შეკვეთის მიხედვით: მიწოდების ღირებულება დაითვლება მთელ შეკვეთაზე','Per class: Charge shipping for each shipping class individually'=>'კლასის მიხედვით: მიწოდების ღირებულება დაითვლება თითოეული კლასის მიხედვით','Calculation type'=>'გაანგარიშების ტიპი','No shipping class cost'=>'არ არის მიწოდების კლასის ღირებულება','"%s" shipping class cost'=>'"%s" მიწოდების კლასის ღირებულება','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'ეს ფასები შესაძლოა დაემატოს <a href="%s">პროდუქტის მიწოდების კლასის</a> მიხედვით.','Shipping class costs'=>'მიწოდების კლასის ღირებულება','Select some countries'=>'აირჩიეთ ქვეყანები','All allowed countries'=>'ყველა ნებადართული ქვეყანა','Availability'=>'ხელმისაწვდომობა','Method title'=>'მეთოდი სათაური','Supports the following placeholders: <code>[qty]</code> = number of items, <code>[cost]</code> = cost of items, <code>[fee percent="10" min_fee="20"]</code> = Percentage based fee.'=>'მხარდაჭერილია შემდეგი შემავსებლები: <code>[qty]</code> = საქონლის რაოდენობა, <code>[cost]</code> = საქონლის ღირებულება, <code>[fee percent="10" min_fee="20"]</code> = საპროცენტო განაკვეთი.','Enter a cost (excl. tax) or sum, e.g. <code>10.00 * [qty]</code>.'=>'შეიტანეთ საფასური (გადასახადების გარეშე), ან ჯამი, მაგ. <code>10.00 * [qty]</code>.','Flat rate'=>'ერთიანი განაკვეთი','Credit card'=>'საკრედიტო ბარათი','[Order #%s]'=>'[შეკვეთა #%s]','Get your API credentials from PayPal.'=>'მიიღეთ API-ს მონაცემები PayPal-ისგან.','Enter your PayPal API credentials to process refunds via PayPal. Learn how to access your <a href="%s">PayPal API Credentials</a>.'=>'მიუთითეთ PayPal-ის API-ს მონაცემები თანხების უკან დასაბრუნებლად. გაიგეთ, როგორ მიიღოთ წვდომა <a href="%s">PayPal API-ს მონაცემებზე</a>.','API credentials'=>'API-ს საანგარიშო მონაცემები','Authorize'=>'ავტორიზაცია','Capture'=>'მიღება','Choose whether you wish to capture funds immediately or authorize payment only.'=>'აირჩიეთ, გსურთ თანხების დაუყოვნებლივ მიღება, თუ ყოველი გადახდის დადასტურება ცალ-ცალკე.','Payment action'=>'გადახდის ქმედება','PayPal verifies addresses therefore this setting can cause errors (we recommend keeping it disabled).'=>'PayPal ამოწმებს მისამართებს, ამიტომ ამ პარამეტრმა შეიძლება გამოიწვიოს შეცდომა (გირჩევთ არ ჩართოთ ის).','Enable "address_override" to prevent address information from being changed.'=>'„address_override“-ის ჩართვა მისამართის შეცვლის თავიდან ასაცილებლად.','Address override'=>'გადასხვაფერებული მისამართი','Send shipping details to PayPal instead of billing.'=>'PayPal-ში მიწოდების დეტალების გადაგზავნა, გადახდის რეკვიზიტების სანაცვლოდ.','Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>'გთხოვთ შეიტანოთ ანგარიშის ნომრის პრეფიქსი. თუ იყენებთ PayPal-ს რამოდენიმე მაღაზიისათვის, ეს პრეფიქსი უნიკალური უნდა იყოს, ვინაიდან PayPal არ მოგცემთ საშუალებას შეუკვეთოთ ერთი და იგივე ანგარიშით.','Invoice prefix'=>'ანგარიშის პრეფიქსი','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'სურვილისამებრ შესაძლებელია ჩაირთოს „გადახდის მონაცემების გადაცემა“ (პროფილი » პროფილი და მორგება > გაყიდვების ჩემი ხელსაწყოები > საიტის პარამეტრები) და საიდენტიფიკაციო მარკერი ჩაისვას აქ. ეს საშუალებას მოგცემთ დაადასტუროთ გადახდები PayPal IPN-ის გარეშე.','PayPal identity token'=>'PayPal-ის იდენტიფიკაციის მარკერი','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'თუ PayPal-ის ძირითადი ელფოსტა განსხვავდება ზემოთ შეტანილისაგან, მაშინ შეიტანეთ ძირითადი მისამართი აქ. მოთხოვნების დასადასტურებლად გამოიყენეთ IPN.','Receiver email'=>'მიმღების ელფოსტა','Advanced options'=>'დამატებითი პარამეტრები','Enable logging'=>'ჟურნალის ჩანაწერების ჩართვა','Debug log'=>'გამართვის ჟურნალი','Enable PayPal sandbox'=>'PayPal საქვიშარის ჩართვა','PayPal sandbox'=>'PayPal საქვიშარი','Please enter your PayPal email address; this is needed in order to take payment.'=>'გთხოვთ შეიტანოთ PayPal-ის თქვენი ანგარიშის ელფოსტა; ეს საჭიროა გადახდის განსახორციელებლად.','PayPal email'=>'PayPal-ის ელფოსტა','Pay via PayPal; you can pay with your credit card if you don\'t have a PayPal account.'=>'გადახდა PayPal-ის საშუალებით; თქვენ შეგიძლიათ გადაიხადოთ საბანკო ბარათით, თუ არ გაქვთ PayPal-ის ანგარიში.','This controls the description which the user sees during checkout.'=>'აღწერა, რომელსაც ხედავს მომხმარებელი შეკვეთის გაფორმებისას.','Enable PayPal Standard'=>'PayPal Standard-ის ჩართვა','Shipping via %s'=>'მიწოდების მეთოდი: %s','PDT payment completed'=>'PDT-გადახდა გატარებულია','Validation error: PayPal amounts do not match (amt %s).'=>'შეცდომა შემოწმებისას: PayPal-ის თანხები არ ემთხვევა (რაოდენობა %s).','Order #%1$s has had a reversal cancelled. Please check the status of payment and update the order status accordingly here: %2$s'=>'შეკვეთა #%1$s გაუქმდა. გთხოვთ შეამოწმოთ გადახდის სტატუსი და განაახლოთ შეკვეთის სტატუსი აქ: %2$s','Reversal cancelled for order #%s'=>'შეკვეთის #%s სტორნირება გაუქმებულია','Order #%1$s has been marked on-hold due to a reversal - PayPal reason code: %2$s'=>'შეკვეთა #%1$s დაყოვნებულია გაუქმების გამო — PayPal-ის მიზეზის კოდი: %2$s','Payment for order %s reversed'=>'შეკვეთის %s გადახდა გაუქმებულია','Order #%1$s has been marked as refunded - PayPal reason code: %2$s'=>'შეკვეთა #%1$s მოინიშნა უკან დასაბრუნებლად — PayPal-ის მიზეზის კოდი: %2$s','Payment %s via IPN.'=>'%s გადახდა IPN-ით.','Payment pending (%s).'=>'გადახდის მოლოდინში (%s).','IPN payment completed'=>'IPN-გადახდა შესრულდა','Validation error: PayPal IPN response from a different email address (%s).'=>'დადასტურების შეცდომა: PayPal IPN-ის პასუხი ელფოსტის სხვა მისამართიდანაა (%s).','Validation error: PayPal amounts do not match (gross %s).'=>'დადასტურების შეცდომა: PayPal-ის თანხები არ ემთხვევა (ბრუტო %s).','Validation error: PayPal currencies do not match (code %s).'=>'დადასტურების შეცდომა: PayPal-ის ვალუტები არ მეთხვევა (კოდი %s).','Refunded %1$s - Refund ID: %2$s'=>'დაბრუნებულია %1$s — დაბრუნების იდენტიფიკატორი: %2$s','PayPal Standard does not support your store currency.'=>'PayPal მხარს არ უჭერს თქვენი მაღაზიის ვალუტას.','Gateway disabled'=>'ანგარიშსწორების არხი გამორთულია','What is PayPal?'=>'რა არის PayPal?','PayPal acceptance mark'=>'PayPal მიღების ნიშანი','PayPal'=>'PayPal','Proceed to PayPal'=>'გაგრძელება PayPal-ით','Payment to be made upon delivery.'=>'გადახდა ნაღდი ფულით.','Accept COD if the order is virtual'=>'ნაღდი ფულით გადახდის ჩართვა ვირტუალური პროდუტებისათვის','Accept for virtual orders'=>'ვირტუალური შეკვეთებისათვის მიღება','Select shipping methods'=>'აირჩიეთ მიწოდების მეთოდები','If COD is only available for certain methods, set it up here. Leave blank to enable for all methods.'=>'თუ ნაღდი ფულით გადახდა ნებადართულია მხოლოდ მიწოდების კონკრეტული სახეობებისათვის, მიუთითეთ ისინი აქ. დატოვეთ ველები ცარიელი, ყველა მეთოდისათვის.','Enable for shipping methods'=>'ჩართულია გადაზიდვის მეთოდებისათვის','Instructions that will be added to the thank you page.'=>'ინსტრუქციები, რომლებიც დაემატება მადლობების გვერდზე.','Pay with cash upon delivery.'=>'გადახდა ნაღდი ფულით შეკვეთის მიღებისას.','Payment method description that the customer will see on your website.'=>'გადახდის მეთოდის აღწერა, რომელსაც მომხმარებელი იხილავს თქვენს ვებ-გვერდზე.','Please send a check to Store Name, Store Street, Store Town, Store State / County, Store Postcode.'=>'გთხოვთ ჩეკი გამოაგზავნოთ მაღაზიის სახელზე და მიუთითეთ ისეთი რეკვიზიტები, როგორიცაა: საფოსტო ინდექსი, ქვეყანა, რეგიონი, ქალაქი, ქუჩა, დასახელება.','Enable check payments'=>'ჩეკებით გადახდის ჩართვა','Branch code'=>'ფილიალის კოდი','Routing number'=>'სვლაგეზის ნომერი','Bank code'=>'საბანკო კოდი','Branch sort'=>'ფილიალის კოდი','IFSC'=>'IFSC კოდი','Bank transit number'=>'ბანკის სატრანზიტო ნომერი','BSB'=>'BSB კოდი','Awaiting BACS payment'=>'უნაღდო მეთოდით გადახდის მოლოდინში','BIC'=>'BIC','Our bank details'=>'ჩვენი საბანკო დეტალები','Remove selected account(s)'=>'მითითებული ანგარიშ(ებ)ის წაშ