se'=>'მონაცემთა ბაზა','WooCommerce plugins may use this method of communication when checking for plugin updates.'=>'WooCommerce-ის პლაგინები შეიძლება იყენებდნენ კავშირის ამ მეთოდს განახლებების შემოწმებისას.','Remote get'=>'დისტანციური მოთხოვნა GET','Error: %s'=>'შეცდომა: %s','PayPal uses this method of communicating when sending back transaction information.'=>'PayPal იყენებს კავშირის ამ მეთოდს ტრანზაქციების შესახებ ინფორმაციის გაგზავნისას.','Remote post'=>'დისტანციური ჩანაწერი','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'GZip (gzopen) გამოიყენება MaxMind-ის GEOIP მონაცემთა ბაზების გასახსნელად.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'თქვენს სერვერზე არ აღმოჩნდა %s კლასი — DOMDocument-ის გარეშე არ იმუშავებს HTML/შედგენილი წერილები და აგრეთვე ზოგიერთი გაფართოება.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'HTML/შედგენილი წერილები იყენებენ DOMDocument-ს ჩადგმული CSS ტილების გენერირებისათვის.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'თქვენს სერვერზე არ არის ჩართული fsockopen, ან cURL — PayPal IPN და სხვა სკრიპტები, რომლებიც უკავშირდებიან სხვა სერვერებს, ვერ იმუშავებენ. დაიკავშირდით ჰოსტინგის მომწოდებელ კომპანიას.','Default timezone is %s - it should be UTC'=>'დროის ნაგულისხმევი სარტყელი %s — უნდა იყოს UTC','The default timezone for your server.'=>'დროის ნაგულისხმევი სარტყელი თქვენი სერვერისათვის.','Default timezone is UTC'=>'ნაგულისხმევი დროის სარტყელი არის UTC','The largest filesize that can be uploaded to your WordPress installation.'=>'ფაილის უდიდესი ზომა, რომელიც შეიძლება აიტვირთოს თქვენს საიტზე.','Max upload size.'=>'ატვირთვის მაქსიმალური ზომა.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'ზოგიერთი ვებ-სერვისი, როგორიცაა მიწოდების სამსახური, იყენებს SOAP-ს ინფორმაციის მისაღებად დაშორებული სერვერებიდან. მაგალითად, FedEx-ის ტარიფების სანახავად დროის რეალურ რეჟიმში საჭიროა SOAP-ის დაყენება.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'ანგარიშსწორების არხებს შეუძლიათ გამოიყენონ cURL დიტანციურ სერვერებთან დასაკავშირებლად, გადახდების ავტორიზაციის პროცესში. სხვა პლაგინებს აგრეთვე შეუძლიათ გამოიყენონ ის გარე სერვისებთან კავშირისათვის.','The version of MySQL installed on your hosting server.'=>'MySQL-ის ვერსია, რომელიც დაყენებულია თქვენი ჰოსტინგის სერვერზე.','MySQL version.'=>'MySQL-ის ვერსია.','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin დაცვის მძლავრი სისტემაა, PHP-ის ენაზე დაწერილი აპლიკაციებისათვის. ეს სისტემა შემუშავებულია სერვერების დასაცავად, ჯერ ერთი, პრობლემების ფართო სპექტრისაგან, მეორეც, უცნობი მოწყვლადობისგან როგორც აპლიკაციაში, აგრეთვე PHP-ის ბირთვში. თუ დაცვა ჩართულია თქვენს სერვერზე, Suhosin მოითხოვს დამატებითი პარამეტრების მორგებას შეტანილი მონაცემების გაზრდის მიზნით.','SUHOSIN installed'=>'SUHOSIN დაყენებულია','The maximum number of variables your server can use for a single function to avoid overloads.'=>'ცვლადების მაქსიმალური ოდენობა, რომლებიც თქვენს სერვერს შეუძლია გამოიყენოს ერთი ფუნქციიდან, დატვირთვის თავიდან ასაცილებლად.','PHP max input vars'=>'PHP-ში შემავალი პარამეტრების რაოდენობა','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'დროის მოცულობა (წამებში), რომელსაც თქვენი საიტი დახარჯავს ცალკეულ ოპერაციაზე ვადის ამოწურვამდე (სერვერის მიუწვდომელობის თავიდან ასაცილებლად)','PHP time limit'=>'PHP-ის შესრულების დროის შეზღუდვა','The largest filesize that can be contained in one post.'=>'ფაილის მაქსიმალური ზომა, რომელიც შეიძლება იყოს ერთ ჩანაწერში.','PHP post max size'=>'PHP მოთხოვნის მაქსიმალური ზომა','The version of PHP installed on your hosting server.'=>'PHP-ის ვერსია, რომელიც დაყენებულია ჰოსტინგის სერვერზე.','PHP version.'=>'PHP-ის ვერსია.','Information about the web server that is currently hosting your site.'=>'ინფორმაცია სერვერის შესახებ, სადაც განთავსებულია თქვენი საიტი.','Server info.'=>'სერვერის ინფორმაცია.','Server environment'=>'სერვერული გარემო','The current language used by WordPress. Default = English'=>'WordPress-ის ინტერფეისის მიმდინარე ენა. ნაგულისხმევად = ინგლისური','Language'=>'ენა','Displays whether or not WordPress is in Debug Mode.'=>'აჩვენებს, ჩართულია WordPress-ის გამართვის რეჟიმი, თუ არა.','The maximum amount of memory (RAM) that your site can use at one time.'=>'მეხსიერების მაქსიმალური ოდენობა, რომლის გამოყენება შეუძლია თქვენს საიტს.','Whether or not you have WordPress Multisite enabled.'=>'ჩართულია, თუ არა თქვენს საიტზე WordPress-ის მულტისაიტი.','The version of WordPress installed on your site.'=>'WordPress-ის ვერსია თქვენს საიტზე.','Several WooCommerce extensions can write logs which makes debugging problems easier. The directory must be writable for this to happen.'=>'WooCommerce-ის ზოგიერთი გაფართოება აწარმოებს ჟურნალს, რაც ადვილებს გამართვას. აღნიშნული საქაღალდე ჩაწერადი უნდა იყოს, რათა ეს შესაძლებლობა ამუშავდეს.','Log directory writable'=>'ჟურნალის დირექტორია ჩაწერადია','The version of WooCommerce installed on your site.'=>'WooCommerce-ის ვერსია თქვენს საიტზე.','The root URL of your site.'=>'თქვენი საიტის ძირითადი URL.','WordPress environment'=>'WordPress-ის გარემო','Copy for support'=>'ინფორმაციის კოპირება მხარდაჭერისათვის','Understanding the status report'=>'სტატუსის ანგარიშგების გაგება','Get system report'=>'სისტემის სტატუსის მიღება','Please copy and paste this information in your ticket when contacting support:'=>'გთხოვთ დააკოპიროთ და ჩასვათ ეს ინფორმაცია ჩვენი მხარდაჭრის სამსახურისათვის:','There are currently no logs to view.'=>'არ არის ჟურნალი სანახავად.','Free'=>'უფასო','Itemized'=>'პოზიციების მიხედვით','As a single total'=>'როგორც ერთიანი შედეგი','Display tax totals'=>'ჯამური გადასახადის ჩვენება','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'განსაზღვრეთ ტექსტი, რომელიც გამოჩნდება თქვენს პროდუქტზე ფასის შემდგომ. მაგალითად, ეს შეიძლება იყოს „დღგ-ს გარეშე“. თქვენ შეგიძლიათ ფასი შეცვალოთ ცვლადებით {price_including_tax}, {price_excluding_tax}.','Price display suffix'=>'ფასების სუფიქსი','Display prices during cart and checkout'=>'ფასების კალათაში ჩვენება, შეკვეთის გაფორმებისას','Excluding tax'=>'გადასახადების გარეშე','Including tax'=>'გადასახადების ჩათვლით','Display prices in the shop'=>'ფასების ჩვენება მაღაზიაში','Additional tax classes'=>'დამატებითი საგადასახადო კლასები','Round tax at subtotal level, instead of rounding per line'=>'გადასახადების დამრგვალება ჯამის დონეზე და არა ყოველი პოზიციისათვის','Rounding'=>'დამრგვალება','Shipping tax class based on cart items'=>'მიწოდების საგადასახადო კლასი ეფუძნება ნივთებს კალათაში','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'სურვილისამებრ, განსაზღვრავს რომელი საგადასახადო კლასი გამოიყენება მიწოდებისას. დატოვეთ ცარიელი ინდივიდუალური განაკვეთისათვის კალათში ნივთის მიხედვით.','Shipping tax class'=>'მიწოდების გადასახადის კლასი','Customer billing address'=>'მომხმარებლის გადახდის მისამართი','Customer shipping address'=>'მომხმარებლის მიწოდების მისამართი','This option determines which address is used to calculate tax.'=>'ეს პარამეტრი განსაზღვრავს, რომელი მისამართი იქნება გამოყენებული გადასახადის დასაანგარიშებლად.','Calculate tax based on'=>'გადასახადების გაანგარიშება','No, I will enter prices exclusive of tax'=>'არა, მე მივუთითებ ფასს გადასახადების გარეშე','Yes, I will enter prices inclusive of tax'=>'დიახ, მე მივუთითებ ფასს გადასახადების ჩათვლით','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'ეს პარამეტრი მნიშვნელოვანია, ვინაიდან განსაზღვრავს როგორი ფასები იქნება შეტანილი. ცვლილება არ შეეხება არსებულ პროდუქტებს.','Prices entered with tax'=>'ფასები მოცემულია გადასახდთან ერთად','Enable taxes'=>'გადასახადების ჩართვა','Save webhook'=>'ვებჰუკის შენახვა','Updated at'=>'განახლებულია','Created at'=>'შექმნილია','Webhook actions'=>'Webhook ქმედებები','Secret'=>'საიდუმლო','URL where the webhook payload is delivered.'=>'URL, სადაც გადაეცემა ვებჰუკის დატვირთვა.','Enter the action that will trigger this webhook.'=>'შეიტანეთ ქმედება, რომელიც გამოიძახებს ამ ვებჰუკს.','Action event'=>'მოქმედების ღონისძიება','Custom'=>'მორგებული','Action'=>'ქმედება','Product deleted'=>'პროდუქტი წაიშალა','Product updated'=>'პროდუქტი განახლდა','Product created'=>'ქმედება შეიქმნა','Order deleted'=>'შეკვეთა წაიშალა','Order updated'=>'შეკვეთა განახლდა','Order created'=>'შეკვეთა შეიქმნა','Customer deleted'=>'მომხმარებელი წაიშალა','Customer updated'=>'მომხმარებელი განახლდა','Customer created'=>'მომხმარებელი შეიქმნა','Coupon deleted'=>'კუპონი წაიშალა','Coupon updated'=>'კუპონი განახლდა','Coupon created'=>'კუპონი შეიქმნა','Select when the webhook will fire.'=>'აირჩიეთ, როდის იქნება ამუშავებული ეს ვებჰუკი.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'პარამეტრები „აქტიურია“ (დატვირთვის მიწოდება), „შეჩერებულია“ (არ მიეწოდება), ან „გამორთულია“ (არ მიეწოდება მიწოდების პრობლემების გამო).','Friendly name for identifying this webhook, defaults to Webhook created on %s.'=>'წაკითხვადი სახელი ამ ვებჰუკის იდენტიფიცირებისათვის. ნაგულისხმევად: ვებჰუკი შეიქმნა %s.','Webhook data'=>'ვებჰუკის მონაცემები','Method'=>'მეთოდი','Tax name'=>'გადასახადის სახელი','State code'=>'შტატის კოდი','Country code'=>'ქვეყნის კოდი','No row(s) selected'=>'სტრიქონ(ებ)ი არ არის არჩეული','Import CSV'=>'CSV ფაილის იმპორტი','Remove selected row(s)'=>'არჩეული სტრიქონ(ებ)ის წაშლა','Insert row'=>'სტრიქონის დამატება','Tax rate ID.'=>'საგადასახადო განაკვეთის იდენტიფიკატორი.','Choose whether or not this tax rate also gets applied to shipping.'=>'აირჩიეთ, მიეკუთვნება ეს საგადასახადო განაკვეთი მიწოდებას, თუ არა.','Choose whether or not this is a compound rate. Compound tax rates are applied on top of other tax rates.'=>'აირჩიეთ, არის ეს განაკვეთი რთული, თუ არა. რთული საგადასახადო განაკვეთი გამოიყენება სხვა განაკვეთებზე უფრო ადრე.','Compound'=>'რთული','Priority'=>'პრიორიტეტი','Enter a name for this tax rate.'=>'შეიტანეთ სახელი ამ საგადასახადო განაკვეთისთვის.','Enter a tax rate (percentage) to 4 decimal places.'=>'შეიტანეთ საგადასახადო განაკვეთი (პროცენტებში) მძიმის შემდეგ ათწილადის 4 ნიშნით.','Rate&nbsp;%'=>'განაკვეთი&nbsp;%','Cities for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all cities.'=>'ქალაქები ამ წესისათვის. წერტილ-მძიმე (;) გამოყოფს რამოდენიმე მნიშვნელობას. დატოვეთ ცარიელი, ყველაზე ქალაქზე მისასადაგებლად.','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'აირჩიეთ ამ საგადსასახდო განაკვეთის პრიორიტეტი. გამოიყენება მხოლოდ 1 შესაბამისი განაკვეთი ყოველი პრიორიტეტისათვის. სხვადსხვა საგადასახადო განაკვეთების განსაზღვრისათვის ერთ ზონაში, უნდა მიუთითოთ სხვადსხვა პრიორიტეტი ყოველი განაკვეთისათვის.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'შტატის 2 სიმბოლოიანი კოდი, მაგალითად, AL. დატოვეთ ცარიელი, ყველაზე მისასადაგებლად.','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'ქვეყნის 2 სიმბოლოიანი კოდი, მაგალითად, GE. დატოვეთ ცარიელი, ყველაზე მისასადაგებლად.','Country&nbsp;code'=>'ქვეყნის&nbsp;კოდი','QRCode'=>'QR კოდი','Consumer secret'=>'მომხმარებლის საიდუმლო კოდი','Copy'=>'კოპირება','Copied!'=>'დაკოპირდა!','Consumer key'=>'სამომხმარებლო გასაღები','Revoke key'=>'გასაღების გაუქმება','Generate API key'=>'API გასაღების შექმნა','Select the access type of these keys.'=>'აირჩიეთ ამ გასაღებზე წვდომის ტიპი.','Owner of these keys.'=>'ამ გასაღებების მფლობელი.','Friendly name for identifying this key.'=>'წაკითხვადი სახელი ამ გასაღების აღნიშვნისათვის.','Key details'=>'გასაღების დეტალები','%s rates'=>'%s განაკვეთები','Standard rates'=>'სტანდარტული ტარიფი','Tax options'=>'საგადასახადო პარამეტრები','ID'=>'იდენტიფიკატორი','Shipping method(s)'=>'მიწოდების მეთოდ(ებ)ი','Ship to specific countries only'=>'მიწოდება მხოლოდ კონკრეტულ ქვეყნებში','Ship to all countries'=>'მიწოდება ყველა ქვეყანაში','Ship to all countries you sell to'=>'მიწოდება იმ ქვეყნებში, რომელშიც აწარმოებთ გაყიდვებს','Choose which countries you want to ship to, or choose to ship to all locations you sell to.'=>'აირჩიეთ ქვეყნები, რომელებშიც აპირებთ პროდუქტის მიწოდებას, ან აირჩიეთ მიწოდება იმ რეგიონებისათვის, რომელშიც აპირებთ აწარმოოთ გაყიდვები.','This controls which shipping address is used by default.'=>'აქ განისაზღვრება, მიწოდების რომელი მისამართი იქნება გამოყენებული ნაგულისხმევად.','Shipping destination'=>'მიწოდების ადგილი','Hide shipping costs until an address is entered'=>'მიწოდების ფასის დაფარვა, სანამ მისამართი არ არის შეტანილი','Enable the shipping calculator on the cart page'=>'მიწოდების დაანგარიშების კალკულარტორის ჩართვა კალათში','Show "verified owner" label on customer reviews'=>'ნიშანის „დამოწმებული მფლობელი“ ჩვენება მომხმარებლების გამოხმაურებებზე','Product ratings'=>'პროდუქტის რეიტინგი','This controls what unit you will define lengths in.'=>'აქ განისაზღვრება ზომის ერთეული, რომლითაც იზომება სიგრძე.','Dimensions unit'=>'გაბარიტების ერთეული','This controls what unit you will define weights in.'=>'აქ განისაზღვრება ზომის ერთეული, რომლითაც იზომება წონა.','Weight unit'=>'წონის ერთეული','Measurements'=>'გაბარიტები','Enable this option to grant access to downloads when orders are "processing", rather than "completed".'=>'ამ პარამეტრის ჩართვა, ჩამოტვირთვებთან წვდომის მისაღებად მაშინ, როდესაც შეკვეთა „მუშავდება“ და არა „დასრულებულია“.','Grant access to downloadable products after payment'=>'ჩამოტვირთვებთან წვდომის მიღება გადახდის შემდეგ','This setting does not apply to guest purchases.'=>'ეს პარამეტრები არ გამოიყენება სტუმრების შენაძენებზე.','Downloads require login'=>'გადმოსაწერად საჭიროა ავტორიზაციის გავლა','Access restriction'=>'წვდომის შეზღუდვა','Redirect only'=>'მხოლოდ გადამისამართება','X-Accel-Redirect/X-Sendfile'=>'X-Accel-Redirect/X-Sendfile','Force downloads'=>'იძულებითი ჩამოტვირთვები','File download method'=>'ფაილის გადმოწერის მეთოდი','Stock display format'=>'მარაგის ჩვენების ფორმატი','Hide out of stock items from the catalog'=>'იმ პროდუქტების დამალვა, რომლებიც არ არის მარაგში','Out of stock visibility'=>'მარაგში არ არსებული პროდუქტების ხილვადობა','Out of stock threshold'=>'„არ არის საწყობში“ — ზღვარი','Low stock threshold'=>'მარაგის მინიმალური ზღვარი','Notification recipient(s)'=>'შეტყობინების მიმღებ(ებ)ი','Enable out of stock notifications'=>'მარაგის ამოწურვის შეტყობინების ჩართვა','Enable low stock notifications'=>'მარაგის შემცირების შეტყობინების ჩართვა','Notifications'=>'შეტყობინენები','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'საწყობში დატოვება (გადაუხდელი შეკვეთებისათვის) x წუთით. როდესაც დროის ლიმიტი ამოიწურება, შეკვეთა გაუქმდება. დატოვეთ ცარიელი, გამორთვისათვის.','Hold stock (minutes)'=>'მარაგის შენარჩუნება (წუთებში)','Enable stock management'=>'მარაგების მართვის ჩართვა','Manage stock'=>'მარაგების მართვა','Enable AJAX add to cart buttons on archives'=>'AJAX კალათში დამატების მეთოდი','Redirect to the cart page after successful addition'=>'კალათში გადამისამართება პროდუქტის დამატებისთანავე','Add to cart behaviour'=>'კალათში დამატება ქმედება','Sort by price (desc)'=>'დალაგება ფასის მიხედვით (დაღმავალი)','Sort by price (asc)'=>'დალაგება ფასის მიხედვით (აღმავალი)','Sort by most recent'=>'ბოლოს დამატებული','Average rating'=>'საშუალო რეიტინგით','Popularity (sales)'=>'პოპულარობით (გაყიდვები)','Default sorting (custom ordering + name)'=>'ნაგულისხმევი დახარისხება (მორგებული დალაგება + სახელი)','Default product sorting'=>'პროდუქტების ნაგულისხმევი დახარისხება','Show subcategories'=>'ქვეკატეგორიების ჩვენება','Show products'=>'პროდუქტების ჩვენება','Shop page display'=>'მაღაზიის გვერდის ჩვენება','This sets the base page of your shop - this is where your product archive will be.'=>'თქვენი მაღაზიის ძირითადი გვერდის დაყენება — აქ გამოჩნდება პროდუქტების არქივი.','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'ამ ძირითადი გვერდის გამოყენება აგრეთვე შეიძლება <a href="%s">პროდუქტების ბმულებისათვის</a>.','Shop page'=>'მაღაზიის მთავარი გვერდი','Integration'=>'ინტეგრაცია','This sets the number of decimal points shown in displayed prices.'=>'ათწილადის თანრიგი ნაჩვენებ ფასებში.','Number of decimals.'=>'ათწილადის თანრიგი.','This sets the decimal separator of displayed prices.'=>'განსაზღვრავს ათწილადის გამყოფს ნაჩვენებ ფასებში.','This sets the thousand separator of displayed prices.'=>'განსაზღვრავს ათასწილადის გამყოფს ნაჩვენებ ფასებში.','This controls the position of the currency symbol.'=>'აკონტროლებს ვალუტის სიმბოლოს მდებარეობას.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'ეს პარამეტრი განსაზღვრავს რომელ ვალუტაშია ჩამოთვლილი ფასები კატალოგში და რომელი ანგარიშსწრების არხები იქნება გამოყენებული.','Currency'=>'ვალუტა','The following options affect how prices are displayed on the frontend.'=>'შემდეგი პარამეტრები მოქმედებენ ფასების გამოსახვაზე ინტერფეისში.','Currency options'=>'ვალუტის პარამეტრები','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'ეს დემო-მაღაზია ტესტირების არის განკუთვნილი — შეკვეთები არ მიიღება.','Store notice'=>'მაღაზიის გაფრთხილება','Geolocate (with page caching support)'=>'გეოლოკაცია (გვერდის ჰეშირების მხარდაჭერით)','Geolocate'=>'გეოლოკაცია','Shop base address'=>'მაღაზიის მისამართი','IP address'=>'IP მისამართი','Specific Countries'=>'კონკრეტული ქვეყნები','Sell to all countries'=>'გაყიდვა ყველა ქვეყანაში','This option lets you limit which countries you are willing to sell to.'=>'ეს ვარიანტი საშუალებას გაძლევთ შეზღუდოთ ქვეყნების რაოდენობა, სადაც აპირებთ გაყიდვას.','Selling location(s)'=>'სავაჭრო წერტილ(ებ)ი','Background color'=>'ფონის ფერი','Base color'=>'ძირითადი ფერი','The text to appear in the footer of all WooCommerce emails.'=>'ტექსტი, რომელიც გამოჩნდება WooCommerce-ის წერილების ქვედა კოლონტიტულში.','Header image'=>'ქუდის სურათი','Email template'=>'ელფოსტის შაბლონი','"From" name'=>'გამომგზავნის სახელი','Email sender options'=>'ელფოსტის გამგზავნის პარამეტრები','Email options'=>'ელფოსტის პარამეტრები','Emails'=>'ელფოსტა','Endpoint for the "Checkout &rarr; Add payment method" page.'=>'საბოლოო წერტილი გვერდისათვის „შეკვეთის გაფორმება > გადახდის მეთოდის დამატება“.','Add payment method'=>'გადახდის მეთოდის დამატება','Endpoint for the "Checkout &rarr; Order received" page.'=>'საბოლოო წერტილი გვერდისათვის „შეკვეთის გაფორმება > შეკვეთა მიღებულია“.','Order received'=>'შეკვეთა მიღებულია','Endpoint for the "Checkout &rarr; Pay" page.'=>'საბოლოო წერტილი გვერდისათვის „შეკვეთის გაფორმება > გადახდა“.','Pay'=>'გადახდა','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'საბოლოო წერტილები ემატება თქვენი გვერდის URL-ს, გარკვეული ქმედებების დასამუშავებლად, შეკვეთის გაფორმების პროცესში. ისინი უნიკალური უნდა იყოს.','Checkout endpoints'=>'შეკვეთის გაფორმების საბოლოო წერტილები','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'თუ განსაზღვავთ გვერდს „წესები“, მ