ი&hellip;','Sale price dates'=>'ფასდაკლების თარიღები','Schedule'=>'დაგეგმილი','This text will be shown on the button linking to the external product.'=>'ნაჩვენები იქნება ღილაკზე, რომელიც დაკავშირებულია გარე პროდუქტთან.','placeholderBuy product'=>'პროდუქტის ყიდვა','Button text'=>'ღილაკის ტექსტი','Enter the external URL to the product.'=>'შეიტანეთ გარე URL პროდუქტისთვის.','Product URL'=>'პროდუქტის URL','SKU refers to a Stock-keeping unit, a unique identifier for each distinct product and service that can be purchased.'=>'არტიკული არის უნიკალური იდენტიფიკატორი ყოველი ცალკეული პროდუქტისათვის, ან მომსახურებისათვის, რომლის შეძენა შესაძლებელია.','Stock Keeping Unit'=>'არტიკული (SKU)','Advanced'=>'დამატებითი','Variations'=>'ნაირსახეობები','Linked Products'=>'დაკავშირებული პროდუქტები','Shipping'=>'მიწოდება','Inventory'=>'მარაგები','Downloadable products give access to a file upon purchase.'=>'ჩამოტვირთვადი პროდუქტის შესყიდვის შემდეგ შესაძლებელია ფაილზე წვდომა.','Virtual products are intangible and are not shipped.'=>'ვირტუალური პროდუქტი არამატერიალურია და არ იგზავნება.','Product Type'=>'პროდუქტის ტიპი','Add'=>'დამატება','Note to customer'=>'მინაწერი მომხმარებელს','Private note'=>'პირადი მინაწერი','Add a note for your reference, or add a customer note (the user will be notified).'=>'დაამატეთ მინაწერი თქვენთვის, ან დაამატეთ მომხმარებლის მინაწერი (მომხმარებელს ეცნობება ამის შესახებ).','Add note'=>'მინაწერის დამატება','There are no notes yet.'=>'მინაწერები ჯერ არ არის.','Delete note'=>'მინაწერის წაშლა','by %s'=>'ავტორი: %s','added on %1$s at %2$s'=>'დამატებულია, თარიღი: %1$s, დრო: %2$s','Grant access'=>'წვდომის მინიჭება','Search for a downloadable product&hellip;'=>'ჩამოტვირთვად პროდუქტებში ძებნა&hellip;','File %d'=>'ფაილი %d','Customer notes about the order'=>'მყიდველის მინაწერი შეკვეთის შესახებ','Customer provided note'=>'მომხმარებლის დატოვებული მინაწერი','No shipping address set.'=>'მიწოდების მისამართი არ მითითებული.','Load shipping address'=>'მიწოდების მისამართის ჩატვირთვა'